-- REVIEWS TABLE

CREATE TABLE IF NOT EXISTS `reviews` (
  `rev_id` int(11) NOT NULL AUTO_INCREMENT,
  `id` int(11) NOT NULL,
  `review` varchar(1000) NOT NULL,
  `username` int(11) NOT NULL,
  PRIMARY KEY (`rev_id`),
  KEY `fk_cat` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

ALTER TABLE `reviews`
  ADD CONSTRAINT `reviews_ibfk_1` FOREIGN KEY (`id`) REFERENCES `prof` (`id`) ON DELETE CASCADE ON UPDATE CASCADE;



